-- ----------------------------
-- View structure for vw_attandacetable
-- ----------------------------
DROP VIEW IF EXISTS `vw_attandacetable`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vw_attandacetable` AS SELECT 
	x.*,
	RANK() over(PARTITION by x.NikKaryawan order by x.NikKaryawan, x.Tanggal ) Rank
FROM (
	SELECT 
		a.NikKaryawan,
		b.NamaKaryawan,
		DATE(TanggalLog) Tanggal,
		c.NamaJabtan	Jabatan,
		d.NamaDepartement Departement,
		e.NamaDevice,
		MAX(CASE WHEN a.LogType = 1 THEN TIME(TanggalLog) END) CheckIn,
		MAX(CASE WHEN a.LogType = 0 THEN TIME(TanggalLog) END) CheckOut
	-- 	dense_rank() over(partition by NikKaryawan,DATE(TanggalLog) order by NikKaryawan,DATE(TanggalLog) desc)
	FROM attandancelog a
	LEFT JOIN masterkaryawan b on a.NikKaryawan = b.Nik
	LEFT JOIN tjabatan c on b.KodeJabatan = c.KodeJabatan
	LEFT JOIN tdepartement d on b.KodeDepartement = d.KodeDepartment
	LEFT JOIN tdevice e on a.DeviceID = e.UniqKey
	GROUP BY a.NikKaryawan, DATE(TanggalLog)
) x ;

