-- ----------------------------
-- Procedure structure for rsp_rekap_absensi
-- ----------------------------
DROP PROCEDURE IF EXISTS `rsp_rekap_absensi`;
delimiter ;;
CREATE PROCEDURE `rsp_rekap_absensi`(IN `TglAwal` date,IN `TglAkhir` date)
BEGIN
	SET @sql = NULL;
	SELECT
		GROUP_CONCAT(DISTINCT
			CONCAT(
				'MAX(CASE WHEN DAY(Tanggal) =',DAY(Tanggal),' THEN TIMEDIFF(CheckOut,CheckIn) END) AS',
				'''T',DAY(Tanggal),''''
			)
		) INTO @sql 
	FROM
		vw_attandacetable a
		where a.Tanggal BETWEEN TglAwal AND TglAkhir;
	-- 	GROUP BY a.NikKaryawan,DAY(Tanggal) ;
	-- 	LEFT JOIN tdatasample b on a.KodeDataSample = b.KodeDataSample;
	SET @sql = CONCAT('SELECT a.NikKaryawan,a.NamaKaryawan, a.Departement, ', @sql, ',
										COUNT(a.Tanggal) TotalMasuk,
										SEC_TO_TIME(SUM(time_to_sec(TIMEDIFF(CheckOut,CheckIn)))) TotalJamKerja
										FROM vw_attandacetable a
										where a.Tanggal BETWEEN ''',TglAwal,''' AND ''',TglAkhir,'''
										GROUP BY a.NikKaryawan');
-- 	SELECT @sql;
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
